import React from "react";
import {MDBBox} from "mdbreact";
import { MDBInput } from "mdbreact";

const InputPage = () => {
  return (
    <MDBInput size label="Enter your name" style={{margin:"0px",color:"black", backgroundColor:"aqua"}} />
  );
}


const BoxPage= (props) => {
    const name="Lewis"
    return(
        <MDBBox className="customBox">
            <InputPage />
            Welcome {name}
        </MDBBox>

    );
}
export default  BoxPage;
